<?php

use App\Modules\Images\ImageService;

it("Optimizes Image", function () {

    $array = ["key" => env("TINYPNG_KEY"), "base64" => "data:image/jpeg;base64,"];
    $image_service = new ImageService();

    $response = $image_service->optimize($array);

    expect($response)->toHaveKeys(["key", "base64"]);

});
